            <strong className="fname">QUI </strong>VAN
          </p>
          <p>I am a software engineer.</p>
          <p className>“Personal development is an unending challenge to see what you can become…”</p>
          <p> <i>– a Wiseman</i></p>
        </div>
      </header>
    </>
  );
};

export default Header;
